data:
  definition: subset of a vector space or a point space which is a vector space or
    a point space, respectively, for the same set of scalars
  examples: []
  notes:
  - The proper subspaces of an stem:[n]-dimensional vector or point space have dimensions
    strictly less than stem:[n].
